  false,\n\t\"url\": null,\n\t\"notes\": \"A total of 105 stations were occupied.
  \ There were two sample grids (southeast Alaska and Yakutat Bay) and two transects
  in the vicinity of Kayak Island.  At each station we sampled using paired 20 and
  60 cm Bongo frames (150 and 500 micron mesh nets, respectively) and a Sameoto neuston
  sampler (500 micron mesh net) to estimate the abundance of zoo- and ichthyoplankton.
  \ A SeaBird SeaCat (SBE 19 plus) was used with the bongo frames to determine the
  depth of the samplers in real time and to measure temperature and conductivity.
  \ At a few selected stations depth-stratified plankton were obtained with a 1 meter
  squared MOCNESS (500 micron mesh nets) and at other selected stations microzooplankton
  were sampled with vertical tows of a CalVET net (53 micron mesh).\",\n\t\"owner_org\":
